insert  into `thongbao`(`id`,`tieude`,`noidung`,`ngaygiotao`,`ngaygiocapnhat`) values (1,'Dùng phần mềm mới kể từ ngày 22/6/2012','<p class=\"MsoListParagraph\" style=\"text-indent:-.25in;line-height:200%;\r\nmso-list:l1 level1 lfo2\"><!--[if !supportLists]-->-<span style=\"font-size: 7pt; line-height: normal; \">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Công ty sẽ chuyển sang dùng phần mềm bán\r\nhàng mới kể từ hôm nay (ngày 2/6/2012), phần mềm này sẽ lưu toàn bộ\r\nthông tin các sản phẩm của công ty tại website: <a href=\"http://www.kinhdoanh.nhilong.com\">kinhdoanh.nhilong.com</a></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:1.0in;line-height:200%\">Username:\r\nusername cũ của mọi người</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:1.0in;line-height:200%\">Password: sẽ\r\ngửi tin nhắn cho từng người</p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-.25in;line-height:200%;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]-->-<span style=\"font-size: 7pt; line-height: normal; \">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Hiện tại còn 1 số đơn hàng chờ giao bên\r\ntrang web cũ dat<a href=\"http://www.banhang.nhilong.com\">hang.nhilong.com</a>\r\nnên trang web này vẫn để đó để tra cứu hàng giao, riêng các đơn hàng\r\nmới, mọi người nhập vào phần mềm mới</p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-.25in;line-height:200%;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]-->-<span style=\"font-size: 7pt; line-height: normal; \">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Đá thư pháp, trang sức đá thì không có\r\nthông tin khách hàng nên sẽ dùng các khách hàng sau khi thanh toán (các\r\nkhách hàng này đã được tạo ra sẵn trong hệ thống)</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:1.0in;line-height:200%\">Lotte quận 7:\r\nA-Khách vãng lai-Lotte Q.7</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:1.0in;line-height:200%\">Maximark:\r\nA-khách vãng lai – Maxi 3/2</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:1.0in;line-height:200%\">Crescent:\r\nA-khách vãng lai – Crescent</p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:200%\"><o:p>&nbsp;</o:p></p>','2012-06-22 07:47:40','2012-06-22 18:44:00'),(2,'Một số lưu ý khi dùng phần mềm này','<p>Một số thay đổi so với phần mềm cũ:</p><div><br></div><div>1. Tất cả các sản phẩm khi bán đều được cập nhật vào đây, trước kia chỉ cập nhật tranh</div><div>2. Các sản phẩm bán không có thông tin khách hàng thì dùng khách hàng tạo sẵn (Khách vãng lai trên phần mềm)</div><div>3. Khi lưu hóa đơn bán các sản phẩm không có xuất hóa đơn thì mã số hóa đơn sẽ theo qui ước: MasocuahangYYMMDDXX (masocuahang : L nếu bán ở Lotte, C: nếu bán ở Crescent, M: nếu bán ở &nbsp;Maxi, YY: năm, MM: tháng, DD:ngày, XX: số thứ tự: 01, 02, 03 .... Ví dụ hàng bán ở Lotte ngày 1 tháng 7 năm 2012, đơn hàng đầu tiên thì sẽ là L12070101,đơn hàng thứ 2 sẽ là L12070102 ....)</div><div>4. Khi đặt tranh thì mã số sản phẩm không theo qui ước cũ là sẽ dùng mã số TDXXXX_AAABBB giống như mã số trong Album của công ty (AAABBB là kích thước tranh. Ví dụ: TD0084_080122: bức mã đáo 80x122, TD0598_060090: Ngôi nhà hạnh phúc 60x90) ....</div><div>5. Khi nhập doanh thu hằng ngày thì sản phẩm gì sẽ được nhập vào cột của sản phẩm đó</div><div><br></div><div>Trân trọng thông báo</div><p></p>','2012-06-23 10:14:43','2012-06-24 18:44:55'),(3,'Chỉ cần cập nhật vòng và đá thư pháp bán ở cuối ca làm việc','Mọi người chú ý, không cần thiết phải cập nhật vòng bán và đá thư pháp bán cho từng khách ở các đơn hàng riêng biệt. Mọi người chỉ cần cập nhật 1 lần ở cuối ca làm việc để đỡ tốn thời gian<div><br></div><div>Trân trọng thông báo</div>','2012-06-23 21:30:37','2012-06-23 21:30:37'),(4,'Cập nhật phần doanh số hàng ngày','Khi nhập doanh số bán hàng hằng ngày, mọi người vẫn nhập theo cách thông thường nghĩa là:<div><br><div>- Cuối ca thứ 1, người là ca 1 sẽ cập nhật số tiền bán được, phần ghi chú sẽ ghi tiền mình bán được.</div><div>- Ca 2 thì cộng tiền bán của ca 1 rồi nhập vào tổng số, phần ghi chú thì ghi phần tiền mình bán được. Không cần ghi cụ thể tiền từng loại vòng đá trong phần này<div>- Tiền thu từ tranh thì không cần nhập trong phần ghi chú</div></div></div>','2012-06-25 08:03:01','2012-06-25 08:03:01'),(5,'Lịch làm việc tuần này - 2/7 - 9/7','<p></p><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"379\" style=\"border-collapse:\r\n collapse;width:284pt\">\r\n <colgroup><col width=\"83\" style=\"mso-width-source:userset;mso-width-alt:3035;width:62pt\">\r\n <col width=\"224\" style=\"mso-width-source:userset;mso-width-alt:8192;width:168pt\">\r\n <col width=\"72\" style=\"mso-width-source:userset;mso-width-alt:2633;width:54pt\">\r\n </colgroup><tbody><tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" width=\"83\" style=\"height:15.0pt;width:62pt\"></td>\r\n  <td colspan=\"2\" class=\"xl65\" width=\"296\" style=\"width:222pt\">LOTTE</td>\r\n </tr>\r\n <tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" style=\"height:15.0pt\"></td>\r\n  <td class=\"xl66\" style=\"border-top:none\">SÁNG</td>\r\n  <td class=\"xl66\" style=\"border-top:none;border-left:none\">CHIỀU</td>\r\n </tr>\r\n <tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" class=\"xl66\" style=\"height:15.0pt\">THỨ 4 04/07</td>\r\n  <td class=\"xl66\" style=\"border-top:none;border-left:none\">HUYỀN</td>\r\n  <td class=\"xl66\" style=\"border-top:none;border-left:none\">TRANG ĐN</td>\r\n </tr>\r\n <tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" class=\"xl66\" style=\"height:15.0pt;border-top:none\">THỨ 5 05/07</td>\r\n  <td class=\"xl66\" style=\"border-top:none;border-left:none\">HUYỀN</td>\r\n  <td class=\"xl66\" style=\"border-top:none;border-left:none\">TRANG ĐN</td>\r\n </tr>\r\n <tr height=\"20\" style=\"height:15.0pt\">\r\n  <td height=\"20\" class=\"xl66\" style=\"he