àng tháng. Công ty sẽ đối chiếu với số liệu ở công ty, nếu khớp thì sẽ tính cho mọi người, nếu không khớp thì sẽ gọi điện cho người đó để đối chiếu</div><div><br></div><div>Mọi người có thể theo dõi xem hàng của mình bán có giao hay chưa bằng cách xem đơn hàng chờ giao trong hệ thống bán hàng của công ty. Nếu đơn hàng vẫn còn trong đơn hàng chờ giao nghĩa là hàng chưa được giao, nếu không có trong đơn hàng chờ giao có nghĩa là hàng đã được giao</div><div><br></div><div>Lương tháng 6 đã được chuyển vào tài khoản của mọi người, trong vòng buổi sáng ngày mai, mọi người sẽ nhận được lương. Nếu có sai sót gì, mọi người liên lạc với chị Hằng</div><div><br></div><div>Trân trọng thông báo</div><p></p>','2012-07-10 08:30:01','2012-07-10 19:22:00'),(7,'Doanh số tháng 7','<p>Để tránh sai sót trong việc tính lương cho mọi người, mọi người nhắn doanh số tháng 7 vào số 0916 909 002 trong ngày 1/8/2012</p><div><br></div><div>- Tổng tiền tranh</div><div>- Tổng tiền vòng</div><div>- Tổng tiền nội thất</div><div><br></div><div>Để làm cơ sở tính lương tháng 7&nbsp;</div><div><br></div><div>Nếu số liệu khớp với số ở công ty thì công ty sẽ trả huê hồng cho mọi người, nếu không khớp thì sẽ gọi điện để làm rõ</div><div><br></div><div>Trân trọng thông báo</div><p></p>','2012-07-31 20:34:48','2012-07-31 20:35:21'),(8,'QUY ĐỊNH VỀ BÁN VÒNG','<p>&nbsp;Không tự ý cắt vòng để xỏ thêm hột đá cho khách hàng</p><div>&nbsp;Kiểm vòng giữa các ca nếu thấy vòng nào nhỏ bất thường hay bị bể thì phải báo với chị Hằng liền. Nếu không báo chị Hằng kiểm tra ở ca nào thấy vòng nhỏ, hoặc bị bể đá thì ca đó chịu trách nhiệm.</div><div>&nbsp;Nhân viên bán hàng có trách nhiệm bảo quản sản phẩm không để bị rớt bể (nếu khách hàng làm rớt thì khách hàng phải mua). Nếu bị rớt bể thì nhân viên đó phải mua luôn sản phẩm đó trong ngày.</div><div><b>&nbsp;Lưu ý nhân viên kiểm kê bàn giao phải kiểm tra kỹ để không có sai sót.</b></div><div>Nhân viên bán vòng đá phải nhập phần mềm từng loại vòng. Nếu mạng bị rớt thì nhắn cho Đức chính xác từng loại vòng để Đức (0918679739) nhập trong ngày</div><div>Riêng đối với Maximark nếu không nhập được trong siêu thị thì nhắn cho Đức trong ngày</div><div><br></div><div><br></div><p></p>','2012-08-01 11:11:07','2012-08-01 11:19:49'),(9,'Chương trình khuyến mãi mua tranh tặng thảm','Hiện tại công ty có chương trình khuyến mãi mua tranh tặng thảm cao cấp:<div><br></div><div>Mua tranh trị giá 14tr được giảm 10% cộng thêm 1 tấm thảm giá 5.500.000</div><div>Mua tranh trị giá 45% được giảm 40% cộng thêm 2 tấm thảm trị giá 5.500.000/tấm</div><div><br></div><div>Hàng mẫu tặng hiện đang trưng bày tại cổng ra vào tại Lotte, có rất nhiều hàng mẫu cho khách lựa chọn.</div>','2012-08-09 09:35:00','2012-08-09 09:35:00'),(10,'Doanh số tháng 7 vừa nhắn tin vào di động cho mọi người','Doanh số mọi người vừa nhận được trên di động là:<div><br></div><div>Tranh: bán từ ngày 31/7/2012 trở về trước và được giao trước ngày 9/8/2012</div><div>Vòng: bán từ ngày 1/7/2012 - 31/7/2012</div><div><br></div><div><br></div>','2012-08-09 11:59:46','2012-08-09 11:59:46'),(11,'Tiền lương tháng 7 đã được chuyển khoản','Tiền lương tháng 7 đã được chuyển vào tài khoản của tất cả mọi người. Trong buổi sáng ngày mai, tiền sẽ vào tài khoản mọi người. Nếu có gì sai sót, mọi người gọi chị Hằng để thông báo<div><br></div><div>Trân trọng thông báo</div>','2012-08-09 21:28:41','2012-08-09 21:28:41'),(12,'cập nhật sản phẩm sau khi nhập đơn hàng','Một số lưu ý khi cập nhật đơn hàng:<div><br></div><div>- Sản phẩm đã bán chỉ được trừ sau khi quản lý duyệt qua các sản phẩm đã bán</div><div>- Sau khi nhập đơn hàng chờ giao, đơn hàng cũng không xuất hiện trong phần đơn hàng chờ giao cho đến khi quản lý duyệt qua</div><div><br></div><div>Công ty thông báo để mọi người biết để tránh thắc mắc</div><div><br></div><div>Trân trọng thông báo</div>','2012-08-10 19:22:12','2012-08-10 19:22:12'),(13,'Cách nhập hóa đơn tranh bán','Nếu tranh khách chọn đã có sẵn, mọi người chọn sản phẩm trong kho để bán. Chú ý không đặt hàng mới, làm vậy sẽ gây nhầm lẫn, bộ phận sản xuất sẽ làm thêm 1 bức mới trong khi bức đó đã có sẵn trong kho hàng<div><br></div><div>Trân trọng thông báo</div>','2012-08-15 17:22:31','2012-08-15 17:22:31'),(14,'Sử dụng hệ thống theo dõi yêu cầu công việc','<p>Kể từ hôm nay, ngày 18/08/2012, công ty sẽ sử dụng hệ thống để theo dõi các công việc để tránh trường hợp có yêu cầu nhưng công ty quên không làm theo yêu cầu của nhân viên:</p><div><br></div><div>- Yêu cầu thêm vòng</div><div>- Yêu cầu thay khung tranh ở showroom</div><div>- Yêu cầu thay tranh ở showroom</div><div>- Yêu cầu sửa tranh ở Showoroom&nbsp;</div><div>- Các ý kiến đóng góp cho công ty để công ty ngày càng phát triển hơn</div><div>...</div><div><br></div><div>Mỗi khi có một yêu cầu mới, người có trách nhiệm sẽ phải giải quyết cho đến khi yêu cầu được giải quyết xong. Hệ thống sẽ được sử dụng tại ykien.thanhlyhangmoi.com&nbsp;</div><div><br></div><div>Trân trọng thông báo</div><div><br></div><p></p>','2012-08-18 17:12:36','2012-08-18 17:13:49'),(15,'Sơ đồ cấu trúc công ty','Kể từ hôm nay ngày 21/8/2012, sơ đồ tổ chức của công ty Nhi Long sẽ như sau:<div><br></div><div><p class=\"MsoNormal\"></p><p class=\"MsoNormal\"><img src=\"http://nhilong.com/sd.jpg\" title=\"Sơ đồ tổ chức công ty\" alt=\"Sơ đồ tổ chức công ty\" style=\"width: 582px; height: 218px; float: left;\"><!--[endif]--></p><!--[endif]--><p></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\">Công ty sẽ giới thiệu chi tiết đến từng nhân viên trong thời gian tới<br></p><p class=\"MsoNormal\">Trân trọng thông báo</p></div>','2012-08-21 20:31:27','2012-08-21 20:39:42'),(16,'NỘI QUY CÔNG TY ĐỐI VỚI NHÂN VIÊN BÁN HÀNG','<p>&nbsp;1. Đi làm đúng giờ theo từng showroom quy định</p><div>&nbsp;2. Mặc đồng phục đúng quy định: áo sơ mi trắng đóng thùng, quần tây màu tối (không mặc quần jean), mang giày. Tóc gọn gàng, không xoả tóc bù xù.</div><div>&nbsp;3. Không bỏ quầy hàng đi qua các quầy khác (nếu bị bắt gặp quá 2 lần sẽ không tính tiền hoa hồng tháng đó)</div><div>&nbsp;4. Bảo đảm các showroom phải sạch sẽ, ngăn nắp, gọn gàng.</div><div>&nbsp;5. Nhân viên ca chiều vô sớm trước 10 phút để bàn giao hàng.</div><div>&nbsp;6. Phải nhiệt tình, vui vẻ, tôn trọng khách hàng. Hòa đồng, thân thiện với nhân viên (chỉ dẫn nhiệt tình cho nhân viên mới)</div><div>&nbsp;7. Có trách nhiệm bảo vệ hàng hóa, sử dụng tiết kiệm các vật dụng công ty.</div><div>Nhân viên thực hiện tốt nội quy sẽ được khen thưởng, nhân viên nào vi phạm, lần 1 nhắc nhở, lần 2 khiển trách, lần 3 không tính tiền thưởng, hoa hồng, lần 4 buộc thôi việc)</div><div>&nbsp;</div><p></p>','2012-08-25 15:51:36','2012-08-25 18:41:44'),(17,'THÔNG TIN TRIỄN LÃM 30/8 ĐẾN 03/9- LỊCH TRIỂN LÃM','&nbsp;Thời gian: 8h - 22h<div>&nbsp;Địa điểm: nhà thi đấu Phú Thọ</div><div>&nbsp;<span style=\"font-size: 12pt; line-height: 115%; \">Hình thức\r\nkhuyến mãi: khách hàng mua 1 bức tranh từ 1 triệu đến dưới 3 triệu giảm 10%, từ\r\n3 triệu đến dưới 6 triệu giảm 15%, từ 6 triệu đến 14 triệu giảm 20%, trên 14\r\ntriệu đến dưới 40 triệu giảm 30%, từ 40 triệu trở lên giảm 40%.</span></div>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%\">&nbsp;Riêng bức 14 triệu được tặng 1 tấm thảm 1m4x2m,\r\nbức 45 triệu tặng 2 tấm thảm. Nếu khách hàng đặt kích thước khác nhưng số tiền\r\ntương đương trên thì phải hỏi cty có được tặng thảm hay giảm giá&nbsp; không. Chương trình áp dụng cho những bức có\r\nkích thước chuẩn hiện đang có ở cty.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-indent:-.5in\"><span style=\"font-size:12.0pt;line-height:115%\"><b><i>LƯU Ý: trong thời gian triễn lãm các nhân\r\nviên hạn chế giao hàng, có thể hẹn khách hàng sau triển lãm để tránh sai sót\r\nkhi giao hàng.</i>