nh bình thường.&nbsp;Nếu đạt doanh số, nhóm nào đạt sẽ được thưởng 3tr ngoài ra:</div><div>- Phần vượt sẽ tính huê hồng 3% nếu vượt dưới 50tr</div><div>- Nếu vượt trên 50tr thì huê hồng phần vượt sẽ tính 3% cho 50tr và 5% cho phần còn lại</div><div><br></div><div>Trân trọng thông báo</div><div><br></div><p></p>','2012-08-30 09:44:27','2012-08-30 09:51:14'),(21,'Chuyển tranh giữa các showroom hoặc giao cho khách','Nhân viên lưu ý,<div><br></div><div>Khi chuyển tranh ra khỏi showroom hoặc nhận tranh từ nơi khác chuyển tới, mọi người gửi 1 cái ticket. Tiêu đề của ticket như sau:</div><div><br></div><div>- Khi nhận tranh: Tranh nhận tại Lotte ngày xx/xx/xx</div><div>- Chuyển tranh: Tranh chuyển từ XXX đi YYY ngày zz/zz/zz (XXX: showroom chuyển, YYY: showroom tới, zz/zz/zz là ngày tháng), Tranh chuyển từ XXX giao cho khách theo hóa đơn ZZZZ (XXX là showroom chuyển tranh đi, ZZZZ là mã hóa đơn)</div><div>- Nội Dung: chi tiết tranh chuyển đi hoặc nhận về, người giao tranh, người nhận tranh</div><div><br></div><div>Khi tranh đưa ra khỏi showroom thì nhân viên đang trực showroom sẽ gửi 1 ticket lên hệ thống, khi nhận tranh ở nơi khách chuyển đến thì nhân viên đang trực sẽ gửi 1 ticket lên hệ thống</div><div><br></div><div>Trân trọng thông báo</div><div><br></div>','2012-09-03 15:49:30','2012-09-03 15:49:30'),(22,'Mở thẻ ngân hàng cho nhân viên','Công ty liên kết với ngân hàng hàng hải (Maritime bank) mở thẻ cho nhân viên với 1 số tiện ích sau:<div><br></div><div>- Không tốn chi phí mở thẻ</div><div>- Không tốn phí hàng tháng để duy trì tài khoản</div><div>- Có thể rút hết tiền trong tài khoản (còn lại 0 đ)</div><div>- Có thể rút ở tất cả các máy ATM của các ngân hàng khác mà không tốn phí</div><div><br></div><div>Nếu nhân viên nào muốn mở thẻ, có thể đăng ký với công ty trước 12h trưa ngày 8/9/2012.</div><div>Hồ sơ gồm: photocopy chứng minh nhân dân và ký vào bộ hồ sơ của ngân hàng. Nhân viên của ngân hàng sẽ đến làm tài khoản tại công ty sau khi đầy đủ danh sách</div><div><br></div><div>Trân trọng thông báo</div>','2012-09-07 11:45:26','2012-09-07 11:45:26'),(23,'TRIỂN LÃM VIETBUILD TỪ 13/09 - 17/09. LỊCH TRIỂN LÃM','&nbsp;Thời gian triển lãm từ 8h đến 20h<div>&nbsp;Hình thức khuyến mãi tại triển lãm tương tự như triển lãm tháng 8</div><div>&nbsp;Trong thời gian triển lãm các nhân viên hạn chế giao hàng, cố gắng hẹn khách hàng qua triển lãm giao hàng càng tốt</div><div><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"1123\" style=\"border-collapse:\r\n collapse;width:845pt\">\r\n <colgroup><col width=\"58\" style=\"mso-width-source:userset;mso-width-alt:2121;width:44pt\">\r\n <col width=\"83\" style=\"mso-width-source:userset;mso-width-alt:3035;width:62pt\">\r\n <col width=\"69\" span=\"3\" style=\"mso-width-source:userset;mso-width-alt:2523;\r\n width:52pt\">\r\n <col width=\"73\" span=\"2\" style=\"mso-width-source:userset;mso-width-alt:2669;\r\n width:55pt\">\r\n <col width=\"70\" style=\"mso-width-source:userset;mso-width-alt:2560;width:53pt\">\r\n <col width=\"73\" span=\"2\" style=\"mso-width-source:userset;mso-width-alt:2669;\r\n width:55pt\">\r\n <col width=\"72\" style=\"mso-width-source:userset;mso-width-alt:2633;width:54pt\">\r\n <col width=\"67\" span=\"3\" style=\"mso-width-source:userset;mso-width-alt:2450;\r\n width:50pt\">\r\n <col width=\"70\" span=\"2\" style=\"mso-width-source:userset;mso-width-alt:2560;\r\n width:53pt\">\r\n </colgroup><tbody><tr height=\"20\" style=\"height:15.0pt\">\r\n  <td rowspan=\"6\" height=\"120\" class=\"xl84\" width=\"58\" style=\"height:90.0pt;width:44pt\">Thảm</td>\r\n  <td colspan=\"2\" class=\"xl82\" width=\"152\" style=\"border-left:none;width:114pt\">Thứ 5</td>\r\n  <td class=\"xl71\" width=\"69\" style=\"width:52pt\">&nbsp;</td>\r\n  <td colspan=\"2\" class=\"xl82\" width=\"142\" style=\"width:107pt\">Thứ 6</td>\r\n  <td class=\"xl71\" width=\"73\" style=\"width:55pt\">&nbsp;</td>\r\n  <td colspan=\"2\" class=\"xl82\" width=\"143\" style=\"width:108pt\">Thứ 7</td>\r\